struct Rectangle { width: f32, height: f32
} impl Rectangle { fn calculate_area(&self) -> f32{ self.width * self.height } fn calculate_perimeter(&self) -> f32 { 2.0 * (self.width + self.height) } fn calculate_diagonal_length(&self) -> f32 { (self.width.powi(2) + self.height.powi(2)).sqrt() }
