The pointer you usually see in Rust is called a reference. A reference points to the memory of another value. A reference means you borrow the value, but you don't own it. ü¶Äü¶Äü¶Äü¶Ä It's the same as our book: the table of contents doesn't own the information. It's the chapters that own the information. In Rust, references have a & in front of them. So: let my_variable = 8 // makes a regular variable
let my_reference = &my_variable // makes a reference. You can also have a reference to a reference, or any number of references. fn main() { let my_number = 15; // This is an i32 let single_reference = &my_number; // This is a &i32 let double_reference = &single_reference; // This is a &&i32 let five_references = &&&&&my_number; // This is a &&&&&i32
}
